	add("punctilio", "{\"term\":\"punctilio\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Spanish\", \"Italian\", \"Latin\"], \"text\":\"Italian \u0027puntiglio\u0027 or Spanish \u0027puntillo\u0027 diminutive from Latin \u0027punctum\u0027 (point)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fine point in exactness of conduct, ceremony or procedure. Strictness in observance of formalities\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1884\u0027\u0027, w:Henry Henry James, \u0026quot;The Path of Duty\u0026quot; in \u0027The English Illustrated Magazine\u0027 \u0027\u00272\u0027\u0027(15): 240–256\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I]t seemed strange to be engaged to so charming a girl and yet go through with it as if it were simply a social duty. If one had n\u0027t been in love with her at first, one ought to have been at the end of a week or two. If Ambrose Tester was not (and to me he did n\u0027t pretend to be), he carried it off, as I have said, better than I should have expected. He was a gentleman, and he behaved like a gentleman, with the added \u0027\u0027punctilio\u0027\u0027, I think, of being sorry for his betrothed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Episode 1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"All those wretched quarrels, in his humble opinion, stirring up bad blood, from some bump of combativeness or gland of some kind, erroneously supposed to be about a \u0027\u0027punctilio\u0027\u0027 of honour and a flag\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1988,\u0027\u0027 w:Alan Alan Hollinghurst, \u0027w:The Swimming Pool The Swimming Pool Library\u0027, Penguin Books (1988), page 25\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Covert gestures of kindness saved me from trouble, or explained the \u0027\u0027punctilio\u0027\u0027 of some futile but unavoidable chore\", \"priority\":7}]}, \"synonyms\":{}}");

	add("punctuation", "{\"term\":\"punctuation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027punctuatio\u0027 () from \u0027punctuare\u0027 () see punctuate.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of symbols and marks which are used to clarify meaning in text by separating strings of words into clauses, phrases and sentences\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An act of punctuating\", \"priority\":2}]}, \"synonyms\":{}}");

	add("puncture", "{\"term\":\"puncture\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or an instance of puncturing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, July 15. Richard Williams in Guardian Unlimited, [http://www.guardian.co.uk/sport/2012/jul/15/tour-de-france-2012-bradley-wiggins Tour de France 2012: Carpet tacks cannot force Bradley Wiggins off track\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A tough test for even the strongest climber, it was new to the Tour de France this year, but its debut will be remembered for the wrong reasons after one of those spectators scattered carpet tacks on the road and induced around 30 \u0027\u0027punctures\u0027\u0027 among the group of riders including Bradley Wiggins, the Tour\u0027s overall leader, and his chief rivals\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A hole, cut, or tear created by a sharp object\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, w:Ken Ken Follett, \u0027Jackdaws\u0027, Dutton, ISBN 0525946284, page 340\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Dieter\u0027s car had suffered a \u0027\u0027puncture\u0027\u0027 on the RN3 road between Paris and Meaux. A bent nail was stuck in the tire\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Ramble\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A lion may perish by the \u0027\u0027puncture\u0027\u0027 of an asp\", \"priority\":8}]}, \"synonyms\":{}}");

	add("punding", "{\"term\":\"punding\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A human activity characterized by compulsive fascination with and performance of repetitive, mechanical tasks, such as assembling and disassembling, collecting, or sorting household objects\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Punding\u0027\u0027 may consist of activities such as collecting pebbles and lining them up as perfectly as possible, or disassembling doorknobs and putting them back together again\", \"priority\":2}]}, \"synonyms\":{}}");

