	add("punishment", "{\"term\":\"punishment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From the Anglo-norman \u0027punisceement\u0027 \u0027punisement\u0027 \u0027punishement\u0027 \u0027punissement\u0027 \u0027punisshement\u0027 and the Middle french (ca. 1400-1600) \u0027punissement\u0027 from the Old french (842-ca. 1400) \u0027pugnissement\u0027 from \u0027\u0027 (puniss-) (the long stem (see the French \u0027-iss-\u0027 of \u0027punir|lang\u003dfr\u0027 () + \u0027-ment\u0027 (see the English \u0027-ment\u0027 . Compare the English nouns \u0027punishing\u0027 and \u0027punition\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of punishing, imposing and/or applying a sanction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A penalty to punish wrongdoing, especially for crime\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A suffering by pain or loss imposed as retributio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any treatment or experience so harsh it feels like being punished; rough handlin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a vehicle that can take a lot of \u0027\u0027punishment\", \"priority\":5}]}, \"synonyms\":{}}");

	add("punkah", "{\"term\":\"punkah\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Hindi \u0027pańkhā\u0027 ‘fan’, from Sanskrit पकशक \u0027pakśaka\u0027, from पकश \u0027pakśa\u0027 ‘wing’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of large fan, common on the Indian subcontinent, especially made from a leaf or from cloth, typically hung from the ceiling, designed to cool a room, often operated manually by a servant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, \u0027HMS Surprise\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Perhaps it was a mistake to invite Mr Stanhope; the day was intolerably hot and humid; all he wanted to do was to lie on his bed with a \u0027\u0027punkah\u0027\u0027 sighing over him, at least moving the unbreathable air\", \"priority\":3}]}, \"synonyms\":{}}");

