	add("punnet", "{\"term\":\"punnet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}A diminutive of \u0027pun\u0027, a dialectal variant of \u0027pound\u0027. \u0027Punnets\u0027, in some places, were used as a measure.The OED says the origin is uncertain - possibly deriving from \u0027pun\u0027, a regional derivative of \u0027pound\u0027 or from the name of of Reginald Crundall Punnett (1875–1967), a geneticist and grower of strawberries who used to sell them in the London market in a small chip basket.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small basket or receptacle for collecting and selling fruit, particularly strawberries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027, Arthur George Liddon Rogers, \u0027The Business Side of Agriculture\u0027, 2010, Forgotten Books, %22punnets%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dbTDxT_qhDqmsiAf79I36DA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22punnets%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 85\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Thus, according to the same \u0027Year-Book\u0027, a sea-kale \u0027\u0027punnet\u0027\u0027 measures 8 in. in diameter at the top and 7½ in. at the bottom, being 2 in. deep, while a radish \u0027\u0027punnet\u0027\u0027 is 8 in. in diameter and 1 in. deep, if to hold six “hands,” or 9 in. by 1 in. for twelve “hands.” A mushroom \u0027\u0027punnet\u0027\u0027 is 7 in. by 1 in., while a salading \u0027\u0027punnet\u0027\u0027 is 5 in. by 2 in\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1917\u0027\u0027, Stevenson Whitcomb Fletcher, \u0027The Strawberry in North America: History, Origin, Botany, and Breeding\u0027, %22punnets%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22punnet%22|%22punnets%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dbTDxT_qhDqmsiAf79I36DA\u0026amp;redir_esc\u003dy pages 77-78\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Another type of splint basket, called a \u0027\u0027punnet\u0027\u0027, was used in the strawberry trade of New York City between 1815 and 1850.\u0027\u0027Punnets\u0027\u0027 and pottles found little favor except in the vicinity of Boston and New York and were soon discarded for more convenient and less expensive packages\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1933\u0027\u0027, South Australian Department of Agriculture and Fisheries, \u0027Journal of Agriculture, South Australia\u0027, Volume 36, %22punnets%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22punnet%22|%22punnets%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dbTDxT_qhDqmsiAf79I36DA\u0026amp;redir_esc\u003dy page 1292\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Most of the fruit for market is picked and sold in \u0027\u0027punnets\u0027\u0027, but for jam making buckets are used, similar to the raspberry bucket\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, New Zealand Department of Agriculture, \u0027New Zealand journal of agriculture\u0027, %22punnets%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22punnet%22|%22punnets%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dbTDxT_qhDqmsiAf79I36DA\u0026amp;redir_esc\u003dy page 13\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Early this season, Ross Lill got together with a plastics firm to produce a flat tray to replace the commonly used \u0027\u0027punnet\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, w:Don Don Burke, \u0027The Complete Burke\u0027s Backyard: The Ultimate Book of Fact Sheets\u0027, %22punnets%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dbTDxT_qhDqmsiAf79I36DA\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"%22punnets%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 408\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"However we recommend, particularly in cooler climates, sowing tomato seeds into a seed tray or \u0027\u0027punnet\u0027\u0027 and allowing the seedlings to grow before they are transplanted into the garden\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 May 13, Amelia Hill, w:The The Guardian, \u0027[http://www.guardian.co.uk/food/Story/0,,2078666,00.html Forget superfoods, you can′t beat an apple a day\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"‘But rather than spend £5 on a small \u0027\u0027punnet\u0027\u0027 of exotic berries, a family would be better off buying regular and larger quantities of fresh fruit and vegetables from their local market.’\", \"priority\":15}]}, \"synonyms\":{}}");

